import React from "react";
import BotCard from "./BotCard";

function YourBotArmy({ botsListed, handleBotActionClick }) {
  const listedBots = botsListed.map((bot) => (
    <BotCard
      key={bot.id}
      bot={bot}
      handleBotActionClick={handleBotActionClick}
    />
  ));

  return (
    <div className="ui segment inverted olive bot-army">
      <div className="ui five column grid">
        <div className="row bot-army-row">
          Your Bot Army
          {listedBots}
        </div>
      </div>
    </div>
  );
}

export default YourBotArmy;
